            s.append(i)
            i += 1
        else :
            t = s.pop()
            a = H[t] * ((i - s[-1] -1)  if s else i)
            if a > m :
                m = a

    while s :
        t = s.pop()
        a = H[t] * ((i - s[-1] -1)  if s else i)
        if a > m :
            m = a

    return m   
