vector<long int> NextSmallerLeft(long int a[],long int n)
{
    vector<long int> ans(n,-1);
    stack<long int> st;
    for(long int i=n-1;i>=0;i--){
        while(!st.empty() && a[st.top()] >= a[i]){
            ans[st.top()]=i;
            st.pop();
        }
        st.push(i);
    }
    return ans;
}

vector<long int> NextSmallerRight(long int a[],long int n)
{
    vector<long int> ans(n,n);
    stack<long int> st;
    for(long int i=0;i<n;i++){
        while(!st.empty() && a[st.top()] > a[i]){
            ans[st.top()]=i;
            st.pop();
        }
        st.push(i);
    }
    return ans;
}

long int maxHistogramArea(long int a[], long int n)
{
    vector<long int> nsl=NextSmallerLeft(a,n);
    vector<long int> nsr=NextSmallerRight(a,n);
    vector<long int> ans(n);
    long int max=0;
    long int area=0;
    for(long int i=0;i<n;i++){
        ans[i]=nsr[i]-nsl[i]-1;
        area=ans[i]*a[i];
        if(area>max)
