int hist(int arr[],int n)
{
    stack<int> s;
    int area=0,tp,pre;
    int i=0,k;
    while(i<n)
    {
        if(s.empty() || arr[s.top()]<=arr[i])
            s.push(i++);
        else
        {
            tp=s.top();
            s.pop();
            if(s.empty())
                k=i;
            else
                k=i-s.top()-1;
            pre=arr[tp]*k;
            if(area<pre)
                area=pre;
        }
    }
    while(!s.empty())
    {
        tp=s.top();
        s.pop();
        if(s.empty())
                k=i;
            else
                k=i-s.top()-1;
            pre=arr[tp]*k;
            if(area<pre)
                area=pre;
    }
    return area;
}
