int maxHistogramArea(int a[], int n)
{
    stack<int> s;
    int max=0,area,i=0,top;
    while(i<n)
    {
        if(s.empty()||a[s.top()]<=a[i])
        {
            s.push(i);
            i++;
        }
        else
        {
            top=s.top();
            s.pop();
            area=a[top]*(s.empty()?(i):(i-1-s.top()));
            if(area>max)
            max=area;
        }
    }
    while(!s.empty())
    {
        top=s.top();
        s.pop();
        area=a[top]*(s.empty()?(i):(i-1-s.top()));
        if(area>max)
            max=area;
    }
    return max;
}
