    stack<int> s;
    vector<int> ans(n,-1);
    for(int i=n-1;i>=0;i--)
    {
        while(!s.empty() && v[i]<v[s.top()])
        {
            ans[s.top()]=i;
            s.pop();
        }
        s.push(i);
    }
    return ans;
