int maxHistogramArea(int a[],int n)
{
    vector<int> v(n);
    for(int i=0;i<n;i++)
        v[i]=a[i];
    vector<int> nsel,nser;
    nser=nextsmallestonleft(v);
    nsel=nextsmallestonright(v);
    int maxarea=INT_MIN;
    for(int i=0;i<n;i++)
    {
        int expansion=nser[i]-nsel[i]-1;
        int curarea=a[i]*expansion;
        maxarea=max(maxarea,curarea);
    }
    return maxarea;
}

